def frequency_sort(n, c, nums):
    counts = [0 for _ in range(c + 1)]
    for num in nums:
        counts[num] += 1
    output = []
    for i in range(c + 1):
        for j in range(counts[i]):
            output.append(i)
    return output

def main():
    n, c = [int(x) for x in input().split()]
    nums = [int(x) for x in input().split()]
    output = frequency_sort(n, c, nums)
    print(' '.join([str(num) for num in output]))

if __name__ == "__main__":
    main()

n, c = map(int, input().split())
