def main():
    N, C = [int(i) for i in input().split()]
    nums = [int(i) for i in input().split()]

    letter_count = [0] * (C + 1)
    for i in nums:
        letter_count[i] += 1

    sorted_nums = []
    for i in range(C + 1):
        sorted_nums += [i] * letter_count[i]

    print(' '.join([str(i) for i in sorted_nums]))

if __name__ == '__main__':
    main()

import sys

def main():
    n, c = [int(x) for x in sys.stdin.readline().split()]
    nums = [int(x) for x in sys.stdin.readline().split()]
    counts = [0] * (c+1)
    for num in nums:
        counts[num] += 1
    for i in range(1, c+1):
        for j in range(counts[i]):
            print(i, end=" ")
    print()

if __name__ == "__main__":
    main()
